import React, { useState, useEffect } from 'react';
import api from '../services/api';
import LoadingSpinner from '../components/LoadingSpinner';

const Teams = () => {
  const [teams, setTeams] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    fetchTeams();
  }, []);

  const fetchTeams = async () => {
    try {
      setLoading(true);
      setError('');
      const response = await api.get('/api/teams');
      console.log('Teams response:', response.data);
      setTeams(response.data || []);
    } catch (error) {
      console.error('Error fetching teams:', error);
      setError('Failed to load teams. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="container">
        <LoadingSpinner size="large" text="Loading teams..." />
      </div>
    );
  }

  return (
    <div className="container">
      <h1 className="welcome-title" style={{ fontSize: '2.5rem', marginBottom: '40px' }}>
        üë• Teams Dashboard
      </h1>

      {error && (
        <div className="error-message">
          ‚ö†Ô∏è {error}
        </div>
      )}

      <div className="card fade-in">
        <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '30px' }}>
          <h2 style={{ 
            fontSize: '1.8rem',
            background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
            WebkitBackgroundClip: 'text',
            WebkitTextFillColor: 'transparent',
            backgroundClip: 'text'
          }}>
            üèÜ All Teams ({teams.length})
          </h2>
          <button 
            onClick={fetchTeams}
            className="btn btn-primary"
            style={{ padding: '8px 16px', fontSize: '14px' }}
          >
            üîÑ Refresh
          </button>
        </div>

        {teams.length === 0 ? (
          <div style={{ 
            textAlign: 'center', 
            padding: '60px 20px',
            background: 'linear-gradient(135deg, rgba(102, 126, 234, 0.05) 0%, rgba(118, 75, 162, 0.05) 100%)',
            borderRadius: '12px',
            border: '2px dashed rgba(102, 126, 234, 0.2)'
          }}>
            <div style={{ fontSize: '4rem', marginBottom: '20px' }}>üë•</div>
            <h3 style={{ color: '#4a5568', marginBottom: '12px' }}>No Teams Found</h3>
            <p style={{ color: '#718096' }}>Teams will appear here once they are created.</p>
          </div>
        ) : (
          <div className="team-list">
            {teams.map((team, index) => (
              <div 
                key={team.id} 
                className="card hover-lift fade-in" 
                style={{ 
                  animationDelay: `${index * 0.1}s`,
                  background: 'linear-gradient(135deg, rgba(255, 255, 255, 0.9) 0%, rgba(255, 255, 255, 0.95) 100%)',
                  border: '1px solid rgba(102, 126, 234, 0.1)'
                }}
              >
                <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start', marginBottom: '16px' }}>
                  <h3 style={{ 
                    color: '#4a5568', 
                    fontSize: '1.4rem',
                    fontWeight: '700',
                    margin: '0'
                  }}>
                    üõ°Ô∏è {team.name}
                  </h3>
                  <span style={{
                    background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
                    color: 'white',
                    padding: '4px 12px',
                    borderRadius: '20px',
                    fontSize: '12px',
                    fontWeight: '600'
                  }}>
                    #{team.id}
                  </span>
                </div>

                {team.description && (
                  <p style={{ color: '#718096', marginBottom: '16px', fontStyle: 'italic' }}>
                    "{team.description}"
                  </p>
                )}

                <div style={{ 
                  display: 'grid', 
                  gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))', 
                  gap: '16px',
                  marginTop: '20px'
                }}>
                  <div style={{ 
                    background: 'rgba(102, 126, 234, 0.1)', 
                    padding: '12px', 
                    borderRadius: '8px' 
                  }}>
                    <div style={{ fontSize: '1.2rem', fontWeight: '700', color: '#667eea' }}>
                      üë§ {team.created_by_name || 'Unknown'}
                    </div>
                    <div style={{ fontSize: '12px', color: '#718096', textTransform: 'uppercase', letterSpacing: '0.5px' }}>
                      Team Leader
                    </div>
                  </div>

                  <div style={{ 
                    background: 'rgba(67, 233, 123, 0.1)', 
                    padding: '12px', 
                    borderRadius: '8px' 
                  }}>
                    <div style={{ fontSize: '1.2rem', fontWeight: '700', color: '#43e97b' }}>
                      üë• {team.member_count || 0}
                    </div>
                    <div style={{ fontSize: '12px', color: '#718096', textTransform: 'uppercase', letterSpacing: '0.5px' }}>
                      Members
                    </div>
                  </div>

                  <div style={{ 
                    background: 'rgba(245, 101, 101, 0.1)', 
                    padding: '12px', 
                    borderRadius: '8px' 
                  }}>
                    <div style={{ fontSize: '1.2rem', fontWeight: '700', color: '#f56565' }}>
                      üìÖ {new Date(team.created_at).toLocaleDateString()}
                    </div>
                    <div style={{ fontSize: '12px', color: '#718096', textTransform: 'uppercase', letterSpacing: '0.5px' }}>
                      Created
                    </div>
                  </div>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default Teams;
